// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Navigate } from 'react-router-dom';
import Auth from './Auth';
import Main from './Main';

const App = () => {
  const isAuthenticated = true; 

  return (
    <Router>
      <Route
        exact
        path="/auth"
        render={() => (isAuthenticated ? <Navigate to="/main" /> : <Auth />)}
      />
      <Route
        exact
        path="/main"
        render={() => (isAuthenticated ? <Main /> : <Navigate to="/auth" />)}
      />
    </Router>
  );
};

export default App;
